import React from 'react';

import './styles.scss';
import { useSelector } from 'react-redux';

export default function Cart() {

    const { show } = useSelector(state => state.cart);

    if (!show) return <div />;

    return (
        <div id="block-cart">
            <div className="header"></div>

            <div className="body"></div>

            <div className="footer"></div>
        </div>
    );
}
